import React from "react";
import Navbar from "./components/layout/Navbar";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <nav className="navbar bg-primary">
        <h1>
          <i className="fab fa-github" /> Navbar
        </h1>
        Navbar />
      </nav>
    );
  }
}
export default App;
